import React, { Component } from 'react';
import { Header } from '../Gallery/style';
import {BigText, LeftSide, FacilitiesArea } from './style';

class Facilities extends Component {
  render() {
    return (
      <div id="facilities">
        <Header>
          <h1>Facilities</h1>
          <p>We have ample infra that resolves all your travel owes.</p>
        </Header>
        <FacilitiesArea>
            <BigText> Huge parking area </BigText>
            <BigText> 24 hours Room Service </BigText>
            <BigText> Commercial establishments in walkable distance</BigText>
            <BigText> Meeting Room </BigText>
            <BigText> 24/7 Reception </BigText>
            <BigText> Laundry/travel/guide service on request </BigText>
        </FacilitiesArea>
        <FacilitiesArea>
            <BigText> Huge parking area </BigText>
            <BigText> 24 hours Room Service </BigText>
            <BigText> Commercial establishments in walkable distance</BigText>
            <BigText> Meeting Room </BigText>
            <BigText> 24/7 Reception </BigText>
            <BigText> Laundry/travel/guide service on request </BigText>
        </FacilitiesArea>
      </div>
    );
  }
}

export default Facilities;
